import React, { Component } from "react";
import { Header, Table } from "semantic-ui-react";

import "../css/Jornadas.css";

class Jornadas extends Component {
  constructor(props) {
    super(props);
    this.state = {
      jornadas: null,
      isLoading: null,
    };
  }

  componentDidMount() {
    this.getPlayers();
  }

  state = {};
  render() {
    return (
      <div>
        <Header>Jornadas</Header>
        <Table>
          <thead>
            <tr>
              <th>Nombre</th>
              <th>Fecha</th>
              <th>Localidad</th>
              <th>Municipio</th>
              <th>idEstado</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>January</td>
              <td>$100</td>
            </tr>
            <tr>
              <td>February</td>
              <td>$80</td>
            </tr>
          </tbody>
          <tfoot>
            <tr>
              <th>Nombre</th>
              <th>Fecha</th>
              <th>Localidad</th>
              <th>Municipio</th>
              <th>idEstado</th>
              <th>Acciones</th>
            </tr>
          </tfoot>
        </Table>
      </div>
    );
  }
}

export default Jornadas;
